    National Oceanic and Atmospheric Administration (NOAA) 1839-1875 T-Sheets",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-03T09:20:31.348070",nt"name": "shapefile-of-historical-new-jersey-shoreline-data-derived-from-national-oceanic-and-atmospheric",nt"isopen":
    false,nt"url": null,nt"notes": "Historical shoreline surveys were conducted
    by the National Ocean Service (NOS), dating back to the early 1800s. The maps resulting
    from these surveys, often called t-sheets, provide a reference of historical shoreline
    position that can be compared to modern data to identify shoreline change. The t-sheets
    are stored at the National Archives and many have been scanned by the National Oceanic
    and Atmospheric Administration (NOAA) and are available on the NOAA Shoreline Web
    site (http://www.shoreline.noaa.gov/data/datasheets/t-sheets.html). While some scanned
    t-sheets were georeferenced and digitized by NOAA, still others remain as non-georeferenced
    raster files (http://nosimagery.noaa.gov/images/shoreline_surveys/survey_scans/NOAA_Shoreline_Survey_Scans.html).
    New_Jersey_1839_75_Digitized_Shoreline.zip features a digitized historic shoreline
    for the New Jersey coastline from 1839 to 1875. The data were scanned by NOAA, but
    were not georeferenced. The t-sheets included in this data release are: T-121 (1839),
    T-119 Part 1 (1841), T-1084 (1868), T-1166 (1870), T-1333 (1871), T-1315a (1872),
    T-1371 (1874), T-1407 (1875). Digital files were georeferenced, corrected to a modern
    datum, and shorelines digitized to provide a vector polyline depicting the historical
    shoreline position. All shorelines, including the foreshore, backshore, mainland
    and island shorelines were delineated and digitized for each survey using ArcMap
    10.3.1. These shorelines were digitized for use in long-term shoreline and wetland
    analyses for Hurricane Sandy wetland physical change assessment.",nt"license_title":
